There is no immediate answer to TUCSON&#39;s question as he was led by
GUILEDART, HARDHEAD and HYDRA down through brush and foliage and
across one path and to the next.

Finally they reach the clearing that held the strange energy door and
stepped through, and immidiately they were all plunged into darkness!

The ground beneath TUSCON&#39;s feet changed as he stepped through. On one
side there was dirt and soil mixed with leaves and discarded branches.
On the other side there was the hard and unyielding feel of cold
metal, there was a scratching noise made as TUSCON&#39;s nails raked
across it as he attempted to keep the same grip he had outside.

As they walked overhead lights began to flicker on and TUSCOn could
see that he was in a hallway, also made of metal, it had the feel of
the interior of a ship or perhaps a base.

They came to a single large door that looked thick enough to stop
grimlock and full rage! In front of it a single Predacon was standing
and he turned to look at GUILDART as he approached. &quot;My my.&quot; He said,
a hiss in his voice. &quot;What have we got here?&quot;

GUILEDART came to a stop, &quot;It is . . . good to see you Rapticon.&quot; He
said as he bowed his head slightly in greeting. &quot;It is a gift for
Magmatron.&quot; He said looking at him warilly.

Behind him HARDHEAD and HYDRA kept their weapons trained on TUSCON,
but there was a definite fear of this creature in front of them as
well.

RAPTICON looked nearly identicle to the transmetaled DINOBOT that
MEGATRON had made near the end of the first Beastwars. He looked like
an armored skeletal version with bladed claws, sharp teeth and a
glowing mechanical optic that replaced on of his more organic looking
ones.

&quot;He does look tasty.&quot; RAPTICON said as he smiled at TUSCON. &quot;But I do
believe that Magmatron will want the pleasure of dealing with him
himself.&quot;

GUIULEDART nodded, &quot;As I would have surmized.&quot;

RAPTICON gestured at the door as he looked at TUSCON, &quot;Magmatron bids
you welcome.&quot; Although his words might seem cordial, the tone and
manner from RAPTICON was anything but!. Instead there was his manner
was that of spider inviting a fly into a web.

He chuckled as he stepped aside and the door began to iris open,
almost like teeth in some great maw opening.

